import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from '../api/axios'

function FavoriteItem(item_id) {

    const URL = `http://127.0.0.1:8080/api/item/id/${item_id.item_id}`
    axios.get(URL).then((response) => {
        var itemInfo = response.data[0]
        return itemInfo
    });

    return (
        <Link to={`/`} className='items-card' >
            <img src={'/'} />
        </Link>
    )

}

export { FavoriteItem }
